// src/components/SearchBar.js
import React from 'react';

const SearchBar = ({ searchTerm, setSearchTerm }) => {
    return (
        <input
            type="text"
            placeholder ="Search events"
            value={searchTerm}
            onChange={e => setSearchTerm(e.target.value)}
        />
    );
};

export default SearchBar;
